import { DesktopOutlined } from '@ant-design/icons';
import './projets.css'

function Projets() {
  const projets = [
  {
    title: "Minishell2",
    description: "Reproduction d'un shell",
    imgUrl : projImg1,
  },
  {
    title: "MyRPG",
    description: "",
    imgUrl : projImg2,
  },
  {
    title: "Need4Stek",
    description: "",
    imgUrl : projImg3,
  }
  ];
  return (
    <section id="projets">
      <Container>
        <Row>
          <Col>
            <h2>Projets</h2>
            <p>Voici quelques projets réalisés durant l'année</p>
          </Col>
        </Row>
      </Container>
    </section>

  );
}

export default Projets;
